import React from 'react';

var outerTableStyle = {
  borderCollapse: 'collapse',
  width: '75%'
};

var innerTableStyle = {
  borderCollapse: 'collapse',
  width: '100%'
};

const tableStyle = function(x) { 
  return {
      position: 'absolute',
      left: x,
      top: '0px'
  };
};

function App() {
  return (
    <table style={outerTableStyle}>
    <tbody>
    <tr>
    <td>
    <table style={innerTableStyle}>
    <tbody>

      <span>Pizza time!</span>

    </tbody>
    </table>  
    </td>
    </tr>
    </tbody>
    </table>
  );
}

export default App;
